import React, { Component } from 'react';
import Navigationbar from './Navigationbar';
import AboutMe from './AboutMe';
import Services from './Services';
class IndexPage extends Component {
    render() {
        return (
            <React.Fragment>
                <Navigationbar />
                <AboutMe />
                <Services />
            </React.Fragment>
        );
    }
}

export default IndexPage;
